import './style.scss';
import {Dispatch, ReactElement} from 'react';
import {connect} from 'react-redux';
import {DState, LoggerComponent, Try} from '../../joiner';
import {FakeStateProps} from '../../joiner/types';
import {DockLayout, LayoutData} from 'rc-dock';
import TestTab from './tabs/TestTab';
import StructureEditor from '../rightbar/structureEditor/StructureEditor';
import {ModelMetaData} from '../rightbar/structureEditor/ModelMetaData';
import TreeEditor from '../rightbar/treeEditor/treeEditor';
import ViewsEditor from '../rightbar/viewsEditor/ViewsEditor';
import NodeEditor from '../rightbar/styleEditor/StyleEditor';
import ViewpointEditor from '../rightbar/viewpointsEditor/ViewpointsEditor';
import CollaboratorsEditor from '../rightbar/collaboratorsEditor/CollaboratorsEditor';
import Console from '../rightbar/console/Console';
import ModelsSummaryTab from './tabs/ModelsSummaryTab';
import DockManager from './DockManager';
import MqttEditor from "../rightbar/mqtt/MqttEditor";
import {PinnableDock, TabContent, TabHeader} from '../dock/MyRcDock';


const tabidprefix = "DockComponent_rightbar_";
let idcounter = 0;
function id(){ // NB: cannot use just indexes or tab title because the id is injected in html, so it must be unique in the whole page.
    return tabidprefix + (idcounter++);
}
function DockComponent(props: AllProps) {
    const groups = {
        'models': {floatable: true, maximizable: true},
        'editors': {floatable: true, maximizable: true}
    };

    /* Models */
    const ModelsSummary = {id: id(), title: <TabHeader>Summary</TabHeader>, group: 'models', closable: false, content: <TabContent><ModelsSummaryTab /></TabContent>};

    /* Editors */
    const test = {id: id(), title: 'Test', group: 'editors', closable: false, content: <TestTab />};
    const structure = {id: id(), title: <TabHeader>Structure</TabHeader>, group: 'editors', closable: false, content: <TabContent><StructureEditor /></TabContent>};
    const metadata = {id: id(), title: <TabHeader>Metadata</TabHeader>, group: 'editors', closable: false, content: <TabContent><ModelMetaData /></TabContent>};
    const tree = {id: id(), title: <TabHeader>Tree View</TabHeader>, group: 'editors', closable: false, content: <TabContent><TreeEditor /></TabContent>};
    const views = {id: id(), title: <TabHeader>Views</TabHeader>, group: 'editors', closable: false, content: <TabContent><ViewsEditor /></TabContent>};
    const node = {id: id(), title: <TabHeader>Node</TabHeader>, group: 'editors', closable: false, content: <TabContent><NodeEditor /></TabContent>};
    const viewpoints = {id: id(), title: <TabHeader>Perspectives</TabHeader>, group: 'editors', closable: false, content: <TabContent><ViewpointEditor validation={false} /></TabContent>};
    const validation = {id: id(), title: <TabHeader>Validation</TabHeader>, group: 'editors', closable: false, content: <TabContent><ViewpointEditor validation={true} /></TabContent>};
    const collaborators = {id: id(), title: <TabHeader>Collaborators</TabHeader>, group: 'editors', closable: false, content: <TabContent><CollaboratorsEditor /></TabContent>};
    const mqtt = {id: id(), title: <TabHeader>Mqtt</TabHeader>, group: 'editors', closable: false, content: <TabContent><MqttEditor /></TabContent>};
    const console = {id: id(), title: <TabHeader>Console</TabHeader>, group: 'editors', closable: false, content: <TabContent><Console /></TabContent>};
    const logger = {id: id(), title: <TabHeader>Logger</TabHeader>, group: 'editors', closable: false, content: <TabContent><LoggerComponent /></TabContent>};

    const layout: LayoutData = {dockbox: {mode: 'horizontal', children: []}};
    layout.dockbox.children.push({tabs: [ModelsSummary]});
    layout.dockbox.children.push({tabs: [
        structure,
        metadata,
        tree,
        views,
        viewpoints,
        validation,
        // collaborators,
        // mqtt,
        node,
        console,
        logger
    ]});

    return (<PinnableDock ref={dock => DockManager.dock = dock} defaultLayout={layout} groups={groups} />);
}
interface OwnProps {}
interface StateProps {}
interface DispatchProps {}
type AllProps = OwnProps & StateProps & DispatchProps;


function mapStateToProps(state: DState, ownProps: OwnProps): StateProps {
    const ret: StateProps = {} as FakeStateProps;
    return ret;
}

function mapDispatchToProps(dispatch: Dispatch<any>): DispatchProps {
    const ret: DispatchProps = {};
    return ret;
}

export const DockConnected = connect<StateProps, DispatchProps, OwnProps, DState>(
    mapStateToProps,
    mapDispatchToProps
)(DockComponent);

const Dock = (props: OwnProps, children: (string | React.Component)[] = []): ReactElement => {
    return <DockConnected {...{...props, children}} />;
}

export default Dock;
